//获取溯源详情
function getSourceDetail(){
    contrLoadingView('on','加载中···');
    ajaxHttp({
        url:'/app/productTraceability/detail',
        type:'POST',
        data:{
            qrCode:sourceCode
        },
        success:function(res){
            contrLoadingView('off');
            if(res.code==0){
                detailData=res.data;
                templateHtml(res.data,'pageTemplate','infoBox');
                initMapView();
            }
        }
    })
}

//初始化地图
function initMapView(){
    var map = new AMap.Map("mapView", {
        resizeEnable: true,
        zoom:18
    });
    var geocoder,marker;
    geocoder = new AMap.Geocoder({
        city: "", //城市设为北京，默认：“全国”
    });
    geocoder.getLocation(detailData.address, function(status, result) {
        if (status === 'complete'&&result.geocodes.length) {
            var lnglat = result.geocodes[0].location
            if(!marker){
                marker = new AMap.Marker();
                map.add(marker);
            }
            marker.setPosition(lnglat);
            map.setCenter(lnglat);
            map.setFitView(marker);
        }
    });
}

