//提交评分
function submitEvaluteStar(score){
    contrLoadingView('on','加载中···');
    ajaxHttp({
        url:'/app/score/save',
        type:'POST',
        data:{
            qrCode:sourceCode,
            score:score
        },
        success:function(res){
            contrLoadingView('off');
            if(res.code==0){
                controlEvaluateAlert('off');
                contrMsgView('评分成功！');
            }else{
                contrMsgView(res.msg);
            }
        }
    })
}

//加载企业自检列表
function loadEselfInspection(){
    ajaxHttp({
        url:'/app/productTraceability/detail/testList',
        type:'POST',
        data:{
            qrCode:sourceCode,
        },
        success:function(res){
            if(res.code==0){
                if(!(res.data.length>0))return;
                for(var i=0,len=res.data.length;i<len;i++){
                    res.data[i].imageList=res.data[i].image==''?[]:res.data[i].image.split(',');
                    res.data[i].strData=encodeURIComponent(JSON.stringify(res.data[i]));
                };
                //console.log(res.data);
                templateHtml(res.data,'eselfInspectionTemplate','eselfInspectionBox');
            }else{
                contrMsgView(res.msg);
            }
        }
    })
}

