//加载购买信息
var buyInfoObj={};
function loadBuyInformation(){
    ajaxHttp({
        url:'/app/productTraceability/detail/bugList',
        type:'POST',
        data:{
            qrCode:sourceCode,
        },
        success:function(res){
            if(res.code==0){
                if(res.data==null)return;
                //console.log(res.data);
                res.data.activeIndex=1;
                buyInfoObj=res.data;
                templateHtml(res.data,'buyInformationTemplate','buyInformationBox');
            }else{
                contrMsgView(res.msg);
            }
        }
    })
}

//点击切换购买信息
function exchangeBuyInformation(index){
    if(index== buyInfoObj.activeIndex)return;
    buyInfoObj.activeIndex=index;
    templateHtml(buyInfoObj,'buyInformationTemplate','buyInformationBox');
}

